import { FC } from 'react';
import { Link } from 'react-router-dom';

import { IoMoon, IoMoonOutline } from 'react-icons/io5';

const Header: FC = () => {
    return (
        <header>
            <div className="container">
                <Link to="/">Where is the world?</Link>
                <button>
                    <IoMoon />
                    <p>Light mode</p>
                </button>
            </div>
        </header>
    );
};

export default Header;
